import React from 'react';
import { PieChart } from 'react-minimal-pie-chart';

class ChartsTester extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: []
        };
    }

    componentDidMount() {
        fetch('http://localhost:9000/testAPI')
          .then(res => res.json())
          .then(users => this.setState({ users }));
    }

    render() {

    }
}
